import logo from './logo.svg';
import './App.css';


const axios = require('axios').default;
const API_KEY = '43f7b7cce2ae5cabfc5e2f76a4248ec7';
function App() {
  return (
    <div className="App">
      <h1>MovieFind</h1>
      <h2>Find the perfect movie for you.</h2>
      <input type="text" placeholder="Search" name="search" id="searchBar"></input>
    </div>
  );
}

document.querySelector("#searchBar").addEventListener('keypress', function(e) {
  if (e.keyCode == 13) {
    var inputText = document.getElementById("searchBar").value;
    axios.get('https://api.themoviedb.org/3/search/key?api_key=' + API_KEY + 'query=' + inputText + 'page=1')
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      })
      .finally(function() {

      });
  }
})

export default App;
